import React from "react";
import Navbar from "../navbar/Navbar"
import Pricing from "../pricing/Pricing"
import Footer from '../footer/Footer';
import Copyright from '../copyright/Copyright';


const PriicngPage = () => {
    return (
        <>
            <Navbar/>
            <Pricing/>
            <Footer/>
            <Copyright/>
        </>
    )
}

export default PriicngPage;
